import React from 'react';
import { Link } from 'react-router-dom';

const Galeri = () => {
  return (
    <nav className="bg-blue-600 p-4 text-white">
      <div className="container mx-auto">
        <ul className="flex space-x-6">
          <li className="relative group">
            <span className="cursor-pointer">Galeri</span>
            <ul className="absolute left-0 mt-2 hidden group-hover:block bg-white text-gray-800 p-2 rounded shadow-lg">
              <li><Link to="/galeri/hewan" className="block px-4 py-2 hover:bg-gray-100">Galeri Hewan</Link></li>
              <li><Link to="/galeri/tumbuhan" className="block px-4 py-2 hover:bg-gray-100">Galeri Tumbuhan</Link></li>
              <li><Link to="/galeri/manusia" className="block px-4 py-2 hover:bg-gray-100">Galeri Manusia</Link></li>
            </ul>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Galeri;
